INSERT INTO `information` (`id`, `related_id`, `cover`, `title`, `content`, `jump_url`, `sortorder`, `create_at`, `status`, `user_id`, `pub_type`, `describe`)
VALUES
	(2,1,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747283063.jpeg','FIFA Online 4 职业联赛S8圆满结束，“电竞北京2020”写下新篇章','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>11月29日，FIFA Online 4 职业联赛第 8 赛季（以下简称&ldquo;FSL S8&rdquo;）决赛于北京市石景山区首创郎园&middot;Park结束。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747318923.jpeg\" /></p>\n<p>FIFA Online 4职业联赛是中国区FIFA Online 4最高级别赛事。FSL本赛季从11月20日举办至11月29日结束，有14支职业战队参赛，共同瓜分总奖池22万元赛事奖金。同时，此次赛事还设置了手游表演赛、街球表演赛等，让更多受众以不同形式感受到了足球和电竞交融的魅力，赛事话题热度随之水涨船高。</p>\n<p>今年，FSLS8由深圳市腾讯信息技术有限公司主办，人民电竞、北京优时光网络科技有限公司承办，北京市石景山区委宣传部作为指导单位，中国联通北京分公司提供网络支持，首创郎园&middot;Park提供场地支持。</p>\n<p>除了在比赛层面吸引了众多观众，赛场之外，FSL也为&ldquo;电竞北京2020&rdquo;活动的进一步落地，为地方电竞产业的发展提供了助力。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747349419.jpeg\" /></p>\n<p>石景山区委宣传部副部长白晓在现场表示，电竞产业是文化产业的重要内容之一，&ldquo;电竞北京2020&rdquo;系列活动能够加快电竞产业的发展，培育新的业态，打造新的文化产业增长点。她说：&ldquo;石景山区作为北京市老工业区，正在进行产业升级改革，优化了营商环境，游戏、电竞产业发展成效显著，今年前三个季度，在新冠疫情的大背景下，以游戏、电竞为代表的文化相关产业实现收入471亿元，同比增长超过54.7%，成为拉动全市文化产业增长由负转正的重要力量。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(3,0,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745374568.jpeg','“青少年绿色电竞教育计划”正式启动','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745399637.jpeg\" /></p>\n<p>人民体育事业发展中心主任王嵩与中国下一代教育基金会秘书长吴涓（左）作为双方代表签约（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>人民网北京11月19日电 由人民体育和中国下一代教育基金会联合打造的&ldquo;青少年绿色电竞教育计划&rdquo;18日在京举行签约仪式。中国下一代教育基金会理事长王萍，人民体育副总经理、首席运营官林峰，中国下一代教育基金会秘书长吴涓，人民体育事业发展中心主任王嵩，人民电竞运营中心副主任陈迪，中国下一代教育基金会副秘书长李亚茹，中国下一代教育基金会副秘书长祁莉莉，中国下一代教育基金会副秘书长可勒等嘉宾出席活动。</p>\n<p>&nbsp;</p>\n<p>经过多年的不断探索，我国的电子竞技正在经历从无序到有序，从不成体系到产业化发展的转变。早在2003年，电子竞技就经国家体育总局批准成为我国正式开展的第99个体育项目，并在2008年被重新定义为第78号体育运动项目。2016年，教育部职业教育与成人教育司公布了13个增补专业，其中&ldquo;电子竞技运动与管理&rdquo;专业包含在内，&ldquo;电子竞技运动与管理&rdquo;被列入高等职业学校增补专业、登入&ldquo;大雅之堂&rdquo;，对该行业有着非同一般的意义。它为电子竞技行业&ldquo;正名&rdquo;的同时，也为培养更多专业电子竞技专业人才，提振行业发展信心。</p>\n<p>&nbsp;</p>\n<p>谈及此次联手中国下一代教育基金会共同打造&ldquo;青少年绿色电竞教育计划&rdquo;的初衷时，人民体育事业发展中心主任王嵩直言，当前越来越多的青少年开始在把电竞当作职业梦想和发展方向。但很多人对电竞的理解比较片面，也有人平衡不好电竞和学习，&ldquo;在这样的情况之下，我们想要打造一个绿色电竞教育计划，也想帮助电竞爱好者的父母们更专业地解决相应的问题，化解和孩子在电竞这件事上的矛盾。&rdquo;</p>\n<p>&nbsp;</p>\n<p>据了解，&ldquo;青少年绿色电竞教育计划&rdquo;由《我是电竞人》《电竞&middot;家》《电竞&middot;营》三个部分组成。其中，《我是电竞人》由中国电竞名人堂选手出席，走进国内各大名校，传播电竞正能量，科普电竞历史，让高校学子和电竞人面对面，还原一个真实的电竞行业现状；《电竞&middot;家》作为大型纪录片，以家庭为缩影，走进50个家庭，探索社会对电竞的认知，共同解决电竞现实难题；《电竞&middot;营》以夏令营和冬令营的方式，面向12-16岁青少年，从电竞科普、亲子教育等方面，寓教于乐地加强青少年对电竞的认知，同时，近年来电竞和XR、VR等高新技术领域的结合，传统桌面型电竞向体育型电竞项目的转变，电竞、体育、科技的多方融合，也让青少年能够在探索科技产物，享受时代便利的同时锻炼身体，强健体魄。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745539063.jpeg\" /></p>\n<p>&nbsp;</p>\n<p>人民体育副总经理、首席运营官林峰在会上强调，人民体育和中国下一代教育基金会双方的合作，契合度非常高，双方联合发起&ldquo;青少年绿色电竞教育计划&rdquo;意义重大，&ldquo;人民体育将充分发挥自身的平台优势，发动传播资源，实现体育强国与下一代教育事业科学发展的双重战略目标。电竞是覆盖众多年轻人，代表着未来科技的新型体育项目，我们也希望青少年绿色电竞教育计划能够让电竞走上一个新的台阶，走上一个被大众正确认知的光明大道。&rdquo;</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745486174.jpeg\" /></p>\n<p>中国下一代教育基金会理事长王萍（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>长期以来，中国下一代教育基金会全力支持我国的学前教育、校外教育和家庭教育，配合政府推动我国下一代教育事业的科学发展，为构建终身教育体系，构建学习型社会作出应有的贡献。对此，中国下一代教育基金会理事长王萍表示，为了适应时代的发展，更好地帮助下一代健康成长，中国下一代教育基金会将逐步从传统的公益事业向新兴的产业领域，电子竞技就是一个很好的代表，&ldquo;电竞的发展已经经历了一段历程，优势、劣势都已经展现给了大众，需要我们为它的内涵做深刻说明。中国下一代教育基金会把教育青少年视为己任，电竞行业年轻人是主力人群，显然也是我们的教育对象。双方的合作，未来一定拥有光明前景，我们也希望通过这次合作对电竞产业的发展有一定积极作用。&rdquo;</p>\n<p>&nbsp;</p>\n<p>此外，有着中国电竞行业领军人物、&ldquo;中国电竞第一人&rdquo;之称的李晓峰和前英雄联盟职业选手、世界冠军禹景曦也受邀前来分享他们与电竞的故事。李晓峰表示，&ldquo;青少年绿色电竞教育计划&rdquo;会成为电竞教育的重要里程碑，未来将投入更多精力为中国的电竞教育事业作出更多的贡献。禹景曦说：&ldquo;我特别期待电竞的青少年教育能够规范化，这样在人才的选择上，在未来的行业规划上，都会越来越好。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(4,0,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747283063.jpeg','FIFA Online 4 职业联赛S8圆满结束，“电竞北京2020”写下新篇章','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>11月29日，FIFA Online 4 职业联赛第 8 赛季（以下简称&ldquo;FSL S8&rdquo;）决赛于北京市石景山区首创郎园&middot;Park结束。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747318923.jpeg\" /></p>\n<p>FIFA Online 4职业联赛是中国区FIFA Online 4最高级别赛事。FSL本赛季从11月20日举办至11月29日结束，有14支职业战队参赛，共同瓜分总奖池22万元赛事奖金。同时，此次赛事还设置了手游表演赛、街球表演赛等，让更多受众以不同形式感受到了足球和电竞交融的魅力，赛事话题热度随之水涨船高。</p>\n<p>今年，FSLS8由深圳市腾讯信息技术有限公司主办，人民电竞、北京优时光网络科技有限公司承办，北京市石景山区委宣传部作为指导单位，中国联通北京分公司提供网络支持，首创郎园&middot;Park提供场地支持。</p>\n<p>除了在比赛层面吸引了众多观众，赛场之外，FSL也为&ldquo;电竞北京2020&rdquo;活动的进一步落地，为地方电竞产业的发展提供了助力。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747349419.jpeg\" /></p>\n<p>石景山区委宣传部副部长白晓在现场表示，电竞产业是文化产业的重要内容之一，&ldquo;电竞北京2020&rdquo;系列活动能够加快电竞产业的发展，培育新的业态，打造新的文化产业增长点。她说：&ldquo;石景山区作为北京市老工业区，正在进行产业升级改革，优化了营商环境，游戏、电竞产业发展成效显著，今年前三个季度，在新冠疫情的大背景下，以游戏、电竞为代表的文化相关产业实现收入471亿元，同比增长超过54.7%，成为拉动全市文化产业增长由负转正的重要力量。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(5,0,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745374568.jpeg','“青少年绿色电竞教育计划”正式启动','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745399637.jpeg\" /></p>\n<p>人民体育事业发展中心主任王嵩与中国下一代教育基金会秘书长吴涓（左）作为双方代表签约（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>人民网北京11月19日电 由人民体育和中国下一代教育基金会联合打造的&ldquo;青少年绿色电竞教育计划&rdquo;18日在京举行签约仪式。中国下一代教育基金会理事长王萍，人民体育副总经理、首席运营官林峰，中国下一代教育基金会秘书长吴涓，人民体育事业发展中心主任王嵩，人民电竞运营中心副主任陈迪，中国下一代教育基金会副秘书长李亚茹，中国下一代教育基金会副秘书长祁莉莉，中国下一代教育基金会副秘书长可勒等嘉宾出席活动。</p>\n<p>&nbsp;</p>\n<p>经过多年的不断探索，我国的电子竞技正在经历从无序到有序，从不成体系到产业化发展的转变。早在2003年，电子竞技就经国家体育总局批准成为我国正式开展的第99个体育项目，并在2008年被重新定义为第78号体育运动项目。2016年，教育部职业教育与成人教育司公布了13个增补专业，其中&ldquo;电子竞技运动与管理&rdquo;专业包含在内，&ldquo;电子竞技运动与管理&rdquo;被列入高等职业学校增补专业、登入&ldquo;大雅之堂&rdquo;，对该行业有着非同一般的意义。它为电子竞技行业&ldquo;正名&rdquo;的同时，也为培养更多专业电子竞技专业人才，提振行业发展信心。</p>\n<p>&nbsp;</p>\n<p>谈及此次联手中国下一代教育基金会共同打造&ldquo;青少年绿色电竞教育计划&rdquo;的初衷时，人民体育事业发展中心主任王嵩直言，当前越来越多的青少年开始在把电竞当作职业梦想和发展方向。但很多人对电竞的理解比较片面，也有人平衡不好电竞和学习，&ldquo;在这样的情况之下，我们想要打造一个绿色电竞教育计划，也想帮助电竞爱好者的父母们更专业地解决相应的问题，化解和孩子在电竞这件事上的矛盾。&rdquo;</p>\n<p>&nbsp;</p>\n<p>据了解，&ldquo;青少年绿色电竞教育计划&rdquo;由《我是电竞人》《电竞&middot;家》《电竞&middot;营》三个部分组成。其中，《我是电竞人》由中国电竞名人堂选手出席，走进国内各大名校，传播电竞正能量，科普电竞历史，让高校学子和电竞人面对面，还原一个真实的电竞行业现状；《电竞&middot;家》作为大型纪录片，以家庭为缩影，走进50个家庭，探索社会对电竞的认知，共同解决电竞现实难题；《电竞&middot;营》以夏令营和冬令营的方式，面向12-16岁青少年，从电竞科普、亲子教育等方面，寓教于乐地加强青少年对电竞的认知，同时，近年来电竞和XR、VR等高新技术领域的结合，传统桌面型电竞向体育型电竞项目的转变，电竞、体育、科技的多方融合，也让青少年能够在探索科技产物，享受时代便利的同时锻炼身体，强健体魄。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745539063.jpeg\" /></p>\n<p>&nbsp;</p>\n<p>人民体育副总经理、首席运营官林峰在会上强调，人民体育和中国下一代教育基金会双方的合作，契合度非常高，双方联合发起&ldquo;青少年绿色电竞教育计划&rdquo;意义重大，&ldquo;人民体育将充分发挥自身的平台优势，发动传播资源，实现体育强国与下一代教育事业科学发展的双重战略目标。电竞是覆盖众多年轻人，代表着未来科技的新型体育项目，我们也希望青少年绿色电竞教育计划能够让电竞走上一个新的台阶，走上一个被大众正确认知的光明大道。&rdquo;</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745486174.jpeg\" /></p>\n<p>中国下一代教育基金会理事长王萍（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>长期以来，中国下一代教育基金会全力支持我国的学前教育、校外教育和家庭教育，配合政府推动我国下一代教育事业的科学发展，为构建终身教育体系，构建学习型社会作出应有的贡献。对此，中国下一代教育基金会理事长王萍表示，为了适应时代的发展，更好地帮助下一代健康成长，中国下一代教育基金会将逐步从传统的公益事业向新兴的产业领域，电子竞技就是一个很好的代表，&ldquo;电竞的发展已经经历了一段历程，优势、劣势都已经展现给了大众，需要我们为它的内涵做深刻说明。中国下一代教育基金会把教育青少年视为己任，电竞行业年轻人是主力人群，显然也是我们的教育对象。双方的合作，未来一定拥有光明前景，我们也希望通过这次合作对电竞产业的发展有一定积极作用。&rdquo;</p>\n<p>&nbsp;</p>\n<p>此外，有着中国电竞行业领军人物、&ldquo;中国电竞第一人&rdquo;之称的李晓峰和前英雄联盟职业选手、世界冠军禹景曦也受邀前来分享他们与电竞的故事。李晓峰表示，&ldquo;青少年绿色电竞教育计划&rdquo;会成为电竞教育的重要里程碑，未来将投入更多精力为中国的电竞教育事业作出更多的贡献。禹景曦说：&ldquo;我特别期待电竞的青少年教育能够规范化，这样在人才的选择上，在未来的行业规划上，都会越来越好。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(6,0,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747283063.jpeg','FIFA Online 4 职业联赛S8圆满结束，“电竞北京2020”写下新篇章','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>11月29日，FIFA Online 4 职业联赛第 8 赛季（以下简称&ldquo;FSL S8&rdquo;）决赛于北京市石景山区首创郎园&middot;Park结束。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747318923.jpeg\" /></p>\n<p>FIFA Online 4职业联赛是中国区FIFA Online 4最高级别赛事。FSL本赛季从11月20日举办至11月29日结束，有14支职业战队参赛，共同瓜分总奖池22万元赛事奖金。同时，此次赛事还设置了手游表演赛、街球表演赛等，让更多受众以不同形式感受到了足球和电竞交融的魅力，赛事话题热度随之水涨船高。</p>\n<p>今年，FSLS8由深圳市腾讯信息技术有限公司主办，人民电竞、北京优时光网络科技有限公司承办，北京市石景山区委宣传部作为指导单位，中国联通北京分公司提供网络支持，首创郎园&middot;Park提供场地支持。</p>\n<p>除了在比赛层面吸引了众多观众，赛场之外，FSL也为&ldquo;电竞北京2020&rdquo;活动的进一步落地，为地方电竞产业的发展提供了助力。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747349419.jpeg\" /></p>\n<p>石景山区委宣传部副部长白晓在现场表示，电竞产业是文化产业的重要内容之一，&ldquo;电竞北京2020&rdquo;系列活动能够加快电竞产业的发展，培育新的业态，打造新的文化产业增长点。她说：&ldquo;石景山区作为北京市老工业区，正在进行产业升级改革，优化了营商环境，游戏、电竞产业发展成效显著，今年前三个季度，在新冠疫情的大背景下，以游戏、电竞为代表的文化相关产业实现收入471亿元，同比增长超过54.7%，成为拉动全市文化产业增长由负转正的重要力量。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(7,0,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745374568.jpeg','“青少年绿色电竞教育计划”正式启动','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745399637.jpeg\" /></p>\n<p>人民体育事业发展中心主任王嵩与中国下一代教育基金会秘书长吴涓（左）作为双方代表签约（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>人民网北京11月19日电 由人民体育和中国下一代教育基金会联合打造的&ldquo;青少年绿色电竞教育计划&rdquo;18日在京举行签约仪式。中国下一代教育基金会理事长王萍，人民体育副总经理、首席运营官林峰，中国下一代教育基金会秘书长吴涓，人民体育事业发展中心主任王嵩，人民电竞运营中心副主任陈迪，中国下一代教育基金会副秘书长李亚茹，中国下一代教育基金会副秘书长祁莉莉，中国下一代教育基金会副秘书长可勒等嘉宾出席活动。</p>\n<p>&nbsp;</p>\n<p>经过多年的不断探索，我国的电子竞技正在经历从无序到有序，从不成体系到产业化发展的转变。早在2003年，电子竞技就经国家体育总局批准成为我国正式开展的第99个体育项目，并在2008年被重新定义为第78号体育运动项目。2016年，教育部职业教育与成人教育司公布了13个增补专业，其中&ldquo;电子竞技运动与管理&rdquo;专业包含在内，&ldquo;电子竞技运动与管理&rdquo;被列入高等职业学校增补专业、登入&ldquo;大雅之堂&rdquo;，对该行业有着非同一般的意义。它为电子竞技行业&ldquo;正名&rdquo;的同时，也为培养更多专业电子竞技专业人才，提振行业发展信心。</p>\n<p>&nbsp;</p>\n<p>谈及此次联手中国下一代教育基金会共同打造&ldquo;青少年绿色电竞教育计划&rdquo;的初衷时，人民体育事业发展中心主任王嵩直言，当前越来越多的青少年开始在把电竞当作职业梦想和发展方向。但很多人对电竞的理解比较片面，也有人平衡不好电竞和学习，&ldquo;在这样的情况之下，我们想要打造一个绿色电竞教育计划，也想帮助电竞爱好者的父母们更专业地解决相应的问题，化解和孩子在电竞这件事上的矛盾。&rdquo;</p>\n<p>&nbsp;</p>\n<p>据了解，&ldquo;青少年绿色电竞教育计划&rdquo;由《我是电竞人》《电竞&middot;家》《电竞&middot;营》三个部分组成。其中，《我是电竞人》由中国电竞名人堂选手出席，走进国内各大名校，传播电竞正能量，科普电竞历史，让高校学子和电竞人面对面，还原一个真实的电竞行业现状；《电竞&middot;家》作为大型纪录片，以家庭为缩影，走进50个家庭，探索社会对电竞的认知，共同解决电竞现实难题；《电竞&middot;营》以夏令营和冬令营的方式，面向12-16岁青少年，从电竞科普、亲子教育等方面，寓教于乐地加强青少年对电竞的认知，同时，近年来电竞和XR、VR等高新技术领域的结合，传统桌面型电竞向体育型电竞项目的转变，电竞、体育、科技的多方融合，也让青少年能够在探索科技产物，享受时代便利的同时锻炼身体，强健体魄。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745539063.jpeg\" /></p>\n<p>&nbsp;</p>\n<p>人民体育副总经理、首席运营官林峰在会上强调，人民体育和中国下一代教育基金会双方的合作，契合度非常高，双方联合发起&ldquo;青少年绿色电竞教育计划&rdquo;意义重大，&ldquo;人民体育将充分发挥自身的平台优势，发动传播资源，实现体育强国与下一代教育事业科学发展的双重战略目标。电竞是覆盖众多年轻人，代表着未来科技的新型体育项目，我们也希望青少年绿色电竞教育计划能够让电竞走上一个新的台阶，走上一个被大众正确认知的光明大道。&rdquo;</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745486174.jpeg\" /></p>\n<p>中国下一代教育基金会理事长王萍（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>长期以来，中国下一代教育基金会全力支持我国的学前教育、校外教育和家庭教育，配合政府推动我国下一代教育事业的科学发展，为构建终身教育体系，构建学习型社会作出应有的贡献。对此，中国下一代教育基金会理事长王萍表示，为了适应时代的发展，更好地帮助下一代健康成长，中国下一代教育基金会将逐步从传统的公益事业向新兴的产业领域，电子竞技就是一个很好的代表，&ldquo;电竞的发展已经经历了一段历程，优势、劣势都已经展现给了大众，需要我们为它的内涵做深刻说明。中国下一代教育基金会把教育青少年视为己任，电竞行业年轻人是主力人群，显然也是我们的教育对象。双方的合作，未来一定拥有光明前景，我们也希望通过这次合作对电竞产业的发展有一定积极作用。&rdquo;</p>\n<p>&nbsp;</p>\n<p>此外，有着中国电竞行业领军人物、&ldquo;中国电竞第一人&rdquo;之称的李晓峰和前英雄联盟职业选手、世界冠军禹景曦也受邀前来分享他们与电竞的故事。李晓峰表示，&ldquo;青少年绿色电竞教育计划&rdquo;会成为电竞教育的重要里程碑，未来将投入更多精力为中国的电竞教育事业作出更多的贡献。禹景曦说：&ldquo;我特别期待电竞的青少年教育能够规范化，这样在人才的选择上，在未来的行业规划上，都会越来越好。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(8,0,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747283063.jpeg','FIFA Online 4 职业联赛S8圆满结束，“电竞北京2020”写下新篇章','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p>11月29日，FIFA Online 4 职业联赛第 8 赛季（以下简称&ldquo;FSL S8&rdquo;）决赛于北京市石景山区首创郎园&middot;Park结束。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747318923.jpeg\" /></p>\n<p>FIFA Online 4职业联赛是中国区FIFA Online 4最高级别赛事。FSL本赛季从11月20日举办至11月29日结束，有14支职业战队参赛，共同瓜分总奖池22万元赛事奖金。同时，此次赛事还设置了手游表演赛、街球表演赛等，让更多受众以不同形式感受到了足球和电竞交融的魅力，赛事话题热度随之水涨船高。</p>\n<p>今年，FSLS8由深圳市腾讯信息技术有限公司主办，人民电竞、北京优时光网络科技有限公司承办，北京市石景山区委宣传部作为指导单位，中国联通北京分公司提供网络支持，首创郎园&middot;Park提供场地支持。</p>\n<p>除了在比赛层面吸引了众多观众，赛场之外，FSL也为&ldquo;电竞北京2020&rdquo;活动的进一步落地，为地方电竞产业的发展提供了助力。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747349419.jpeg\" /></p>\n<p>石景山区委宣传部副部长白晓在现场表示，电竞产业是文化产业的重要内容之一，&ldquo;电竞北京2020&rdquo;系列活动能够加快电竞产业的发展，培育新的业态，打造新的文化产业增长点。她说：&ldquo;石景山区作为北京市老工业区，正在进行产业升级改革，优化了营商环境，游戏、电竞产业发展成效显著，今年前三个季度，在新冠疫情的大背景下，以游戏、电竞为代表的文化相关产业实现收入471亿元，同比增长超过54.7%，成为拉动全市文化产业增长由负转正的重要力量。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',100,1666666666,0,'88888888',1,NULL),
	(9,0,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747283063.jpeg','视频视频～～','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p><video controls=\"controls\" width=\"300\" height=\"150\">\n<source src=\"http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/901c5fd15285890817637818402/f0.mp4\" type=\"video/mp4\" /></video></p>\n<p>test &nbsp;</p>\n<p><video controls=\"controls\" width=\"300\" height=\"150\" data-mce-fragment=\"1\">\n<source src=\"http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/901c5fd15285890817637818402/f0.mp4\" type=\"video/mp4\" /></video></p>\n<p>test</p>\n<p><video controls=\"controls\" width=\"300\" height=\"150\" data-mce-fragment=\"1\">\n<source src=\"http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/901c5fd15285890817637818402/f0.mp4\" type=\"video/mp4\" /></video></p>\n<p>test</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(10,1,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609747283063.jpeg','赛事回放～～','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p><video controls=\"controls\" width=\"300\" height=\"150\">\n<source src=\"http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/901c5fd15285890817637818402/f0.mp4\" type=\"video/mp4\" /></video></p>\n<p>test &nbsp;</p>\n<p><video controls=\"controls\" width=\"300\" height=\"150\" data-mce-fragment=\"1\">\n<source src=\"http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/901c5fd15285890817637818402/f0.mp4\" type=\"video/mp4\" /></video></p>\n<p>test</p>\n<p><video controls=\"controls\" width=\"300\" height=\"150\" data-mce-fragment=\"1\">\n<source src=\"http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/901c5fd15285890817637818402/f0.mp4\" type=\"video/mp4\" /></video></p>\n<p>test</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
	(11,1,'https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745374568.jpeg','“青少年绿色电竞教育计划”正式启动','<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745399637.jpeg\" /></p>\n<p>人民体育事业发展中心主任王嵩与中国下一代教育基金会秘书长吴涓（左）作为双方代表签约（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>人民网北京11月19日电 由人民体育和中国下一代教育基金会联合打造的&ldquo;青少年绿色电竞教育计划&rdquo;18日在京举行签约仪式。中国下一代教育基金会理事长王萍，人民体育副总经理、首席运营官林峰，中国下一代教育基金会秘书长吴涓，人民体育事业发展中心主任王嵩，人民电竞运营中心副主任陈迪，中国下一代教育基金会副秘书长李亚茹，中国下一代教育基金会副秘书长祁莉莉，中国下一代教育基金会副秘书长可勒等嘉宾出席活动。</p>\n<p>&nbsp;</p>\n<p>经过多年的不断探索，我国的电子竞技正在经历从无序到有序，从不成体系到产业化发展的转变。早在2003年，电子竞技就经国家体育总局批准成为我国正式开展的第99个体育项目，并在2008年被重新定义为第78号体育运动项目。2016年，教育部职业教育与成人教育司公布了13个增补专业，其中&ldquo;电子竞技运动与管理&rdquo;专业包含在内，&ldquo;电子竞技运动与管理&rdquo;被列入高等职业学校增补专业、登入&ldquo;大雅之堂&rdquo;，对该行业有着非同一般的意义。它为电子竞技行业&ldquo;正名&rdquo;的同时，也为培养更多专业电子竞技专业人才，提振行业发展信心。</p>\n<p>&nbsp;</p>\n<p>谈及此次联手中国下一代教育基金会共同打造&ldquo;青少年绿色电竞教育计划&rdquo;的初衷时，人民体育事业发展中心主任王嵩直言，当前越来越多的青少年开始在把电竞当作职业梦想和发展方向。但很多人对电竞的理解比较片面，也有人平衡不好电竞和学习，&ldquo;在这样的情况之下，我们想要打造一个绿色电竞教育计划，也想帮助电竞爱好者的父母们更专业地解决相应的问题，化解和孩子在电竞这件事上的矛盾。&rdquo;</p>\n<p>&nbsp;</p>\n<p>据了解，&ldquo;青少年绿色电竞教育计划&rdquo;由《我是电竞人》《电竞&middot;家》《电竞&middot;营》三个部分组成。其中，《我是电竞人》由中国电竞名人堂选手出席，走进国内各大名校，传播电竞正能量，科普电竞历史，让高校学子和电竞人面对面，还原一个真实的电竞行业现状；《电竞&middot;家》作为大型纪录片，以家庭为缩影，走进50个家庭，探索社会对电竞的认知，共同解决电竞现实难题；《电竞&middot;营》以夏令营和冬令营的方式，面向12-16岁青少年，从电竞科普、亲子教育等方面，寓教于乐地加强青少年对电竞的认知，同时，近年来电竞和XR、VR等高新技术领域的结合，传统桌面型电竞向体育型电竞项目的转变，电竞、体育、科技的多方融合，也让青少年能够在探索科技产物，享受时代便利的同时锻炼身体，强健体魄。</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745539063.jpeg\" /></p>\n<p>&nbsp;</p>\n<p>人民体育副总经理、首席运营官林峰在会上强调，人民体育和中国下一代教育基金会双方的合作，契合度非常高，双方联合发起&ldquo;青少年绿色电竞教育计划&rdquo;意义重大，&ldquo;人民体育将充分发挥自身的平台优势，发动传播资源，实现体育强国与下一代教育事业科学发展的双重战略目标。电竞是覆盖众多年轻人，代表着未来科技的新型体育项目，我们也希望青少年绿色电竞教育计划能够让电竞走上一个新的台阶，走上一个被大众正确认知的光明大道。&rdquo;</p>\n<p>&nbsp;</p>\n<p><img class=\"wscnph\" src=\"https://fpv-1251316249.cos.ap-shanghai.myqcloud.com/fpv/1609745486174.jpeg\" /></p>\n<p>中国下一代教育基金会理事长王萍（王友民 摄）</p>\n<p>&nbsp;</p>\n<p>长期以来，中国下一代教育基金会全力支持我国的学前教育、校外教育和家庭教育，配合政府推动我国下一代教育事业的科学发展，为构建终身教育体系，构建学习型社会作出应有的贡献。对此，中国下一代教育基金会理事长王萍表示，为了适应时代的发展，更好地帮助下一代健康成长，中国下一代教育基金会将逐步从传统的公益事业向新兴的产业领域，电子竞技就是一个很好的代表，&ldquo;电竞的发展已经经历了一段历程，优势、劣势都已经展现给了大众，需要我们为它的内涵做深刻说明。中国下一代教育基金会把教育青少年视为己任，电竞行业年轻人是主力人群，显然也是我们的教育对象。双方的合作，未来一定拥有光明前景，我们也希望通过这次合作对电竞产业的发展有一定积极作用。&rdquo;</p>\n<p>&nbsp;</p>\n<p>此外，有着中国电竞行业领军人物、&ldquo;中国电竞第一人&rdquo;之称的李晓峰和前英雄联盟职业选手、世界冠军禹景曦也受邀前来分享他们与电竞的故事。李晓峰表示，&ldquo;青少年绿色电竞教育计划&rdquo;会成为电竞教育的重要里程碑，未来将投入更多精力为中国的电竞教育事业作出更多的贡献。禹景曦说：&ldquo;我特别期待电竞的青少年教育能够规范化，这样在人才的选择上，在未来的行业规划上，都会越来越好。&rdquo;</p>\n<p>&nbsp;</p>\n</body>\n</html>','',0,1666666666,0,'88888888',1,NULL),
