	(392,'【\nFPV\n年度】碟中谍：魔幻之都','一直一来都想拥有一部上海FPV的作品，2020终于有能力和机会来完成这个想法，有幸再次和上海官方合作拍摄城市形象宣传片，同时也在上海拍摄了一些广告，得已在禁飞区内飞行，所以才有了这个视频。再次申明，视频中飞行区域均为禁飞区，需要报备才能飞行，FPV飞行比传统航拍风险要大很多，请大家不要模仿或者黑飞，共同维护良好的FPV环境！作品素材来自2020进博会宣传片、浦东改革开放30周年宣传片、2021世界技能大赛宣传片、马爹利tvc、大众途铠tvc、哈雷tvc，感兴趣可自行搜索，会找到和本片相关的镜头','http://1253904687.vod2.myqcloud.com/ed8f6bf4vodtransgzp1253904687/901c64135285890817637818503/coverBySnapshot/coverBySnapshot_10_0.jpg','http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/3237ef595285890817629329817/f0.mp4','13918242',1,0,3,0,0,217040,'','',1280,720,1621423785,1621423785,5285890817629329817,49391185,'[{\"type\":\"2\",\"url\":\"http://1253904687.vod2.myqcloud.com/ed8f6bf4vodtransgzp1253904687/3237ef595285890817629329817/v.f100020.mp4\",\"size\":28246377,\"duration\":217132},{\"type\":\"3\",\"url\":\"http://1253904687.vod2.myqcloud.com/ed8f6bf4vodtransgzp1253904687/3237ef595285890817629329817/v.f100230.m3u8\",\"size\":50584294,\"duration\":217132}]',0,0,0,0,0),
