	(490,'当你想要拍\nFPV\n手里却只有一台Mavic','小建议/技巧\n使用运动模式，更改EXP，把中间右转左转的数值改到0.1（防止过度转弯）\n快捷转换跟随/FPV模式，将C1或C2设置为云台跟随/FPV\n使用高快门速度进行拍摄，降低防抖难度，减少电影感，增加运动感\nMavic 2 Pro 可以使用FOV获得更广的视角\n在左右转弯的时候同时打两边的杆\n降低飞行高度，提升飞行速度','http://1253904687.vod2.myqcloud.com/ed8f6bf4vodtransgzp1253904687/901c6dc35285890817637818798/coverBySnapshot/coverBySnapshot_10_0.jpg','http://1253904687.vod2.myqcloud.com/3967c94cvodgzp1253904687/901c6dbe5285890817637818793/f0.mp4','13918242',1,0,1,0,0,338571,'','',1280,720,1621425645,1621425645,5285890817637818793,80588708,'[{\"type\":\"2\",\"url\":\"http://1253904687.vod2.myqcloud.com/ed8f6bf4vodtransgzp1253904687/901c6dbe5285890817637818793/v.f100020.mp4\",\"size\":23787652,\"duration\":338666},{\"type\":\"3\",\"url\":\"http://1253904687.vod2.myqcloud.com/ed8f6bf4vodtransgzp1253904687/901c6dbe5285890817637818793/v.f100230.m3u8\",\"size\":41312320,\"duration\":338666}]',0,1,0,0,0),
